import 'bootstrap/dist/css/bootstrap.min.css';
import React from "react";
import CategoriesElements from './CategoriesElements';
import '../../styles.css';

function Categories() {
    return (
        <>  <div>HOMEPAGE
            <h1 className="title">TITULO</h1>
            <div className="father">
                <CategoriesElements category="Comparsas" image={'../../images/comparsa-la-eternidad-martinez-ares.jpg'}>Comparsas</CategoriesElements>
                <CategoriesElements category="Chirigotas">Chirigotas</CategoriesElements>
                <CategoriesElements category="Cuartetos">Cuartetos</CategoriesElements>
                <CategoriesElements category="Coros">Coros</CategoriesElements>

            </div>
        </div>
        </>
    );
}


export default Categories;
